import React from 'react';
import './Pager.css';

//hard coded values
const previous = 0;
const next = 2;


export default function Pager({pages,current}) {
    return (
        <div id="pagerComponent">
            {previous && <div id="previousPagerController">
            <div></div> 
                <div>{previous}</div></div>}
            <div>{current}</div>
            {next && <div id="nextPagerController"><div>{next}</div> <div>end</div></div>}
        </div>
    )
}
